package com.highstreets.user.models;import com.google.gson.annotations.SerializedName;public class branded_shop {    @SerializedName("offer_id")    private String OfferID;    @SerializedName("name")    private String OfferName;    @SerializedName("description")    private String OfferDescription;    @SerializedName("offer_type_id")    private String OfferTypeID;    @SerializedName("featured_image")    private String OfferFeaturedImage;    @SerializedName("mrp_price")    private String OfferMrpPrice;    @SerializedName("offer_percentage")    private String OfferPercentage;    @SerializedName("offer_price")    private String OfferPrice;    public String getOfferID() {        return OfferID;    }    public void setOfferID(String offerID) {        OfferID = offerID;    }    public String getOfferName() {        return OfferName;    }    public void setOfferName(String offerName) {        OfferName = offerName;    }    public String getOfferDescription() {        return OfferDescription;    }    public void setOfferDescription(String offerDescription) {        OfferDescription = offerDescription;    }    public String getOfferTypeID() {        return OfferTypeID;    }    public void setOfferTypeID(String offerTypeID) {        OfferTypeID = offerTypeID;    }    public String getOfferFeaturedImage() {        return OfferFeaturedImage;    }    public void setOfferFeaturedImage(String offerFeaturedImage) {        OfferFeaturedImage = offerFeaturedImage;    }    public String getOfferMrpPrice() {        return OfferMrpPrice;    }    public void setOfferMrpPrice(String offerMrpPrice) {        OfferMrpPrice = offerMrpPrice;    }    public String getOfferPercentage() {        return OfferPercentage;    }    public void setOfferPercentage(String offerPercentage) {        OfferPercentage = offerPercentage;    }    public String getOfferPrice() {        return OfferPrice;    }    public void setOfferPrice(String offerPrice) {        OfferPrice = offerPrice;    }}